description:
And finally, relieta finished the last two books, so we now have the full collection of Clara After Dark, by Jordi Bernet.


Relieta has once again done an amazing job in both restoring the pages, and translating the books, and I did my part with proofreading and doing editorial work on them.

There have been a few Clara books out in english, but official and scanlations, under the names Betty by Night, The best of Betty or Betty by the Hour. For some reason, they decided to rename Clara to a name similar to the inspiration for her, Bettie Page.

But for those of you that dont know Clara/Betty, she is a &quot;lady of the night&quot;, a whore with a heart of gold, who tries to raise her son as a single mom who have had to make some hard choices in her life.
The comic itself is two page gags about Claras life, what she gets up to with her job, her friends, and her son.
Mainly it is a comedy book, but with the occasional dose of social realism that quite clearly contrasts and offset the humor in the book, nicely balancing out the books.

This book is NOT for children, it do feature nudity and sexual acts, though it is softcore, nothing worse than you can see on the average HBO TV show :)

